                        <div className="row ">
                            <span className="btn-left mx-auto col-md-6  col-10">
                            <button  onClick={()=>{
                                props.history.push('/signup')
                            }} >A Business Leader</button>
                            </span>
                            <span className=" btn-right col-md-6 col-10">
                            <button 
