                            </span>
                        </div>
                      

                         </div> 
                           <span
                            onClick={()=>{
                                props.history.push('/dashboard')
                            }} className="back">Go back</span>
                       
                      </div>

                   

                  </div>
                  

                </div>
            </React.Profiler>
        </React.Fragment>
    )
}

export default withRouter(Service)
